import React, { useState } from "react";
import Menu from './menu.json'

  const GalleryReact = () => {
    // Flatten the categories array for all items
    const categories = Menu.reduce((acc, item) => {
      item.category.forEach((category) => {
        if (!acc.includes(category)) {
          acc.push(category);
        }
      });
      return acc;
    }, []);


    // Filter items based on the selected category
  const handleCategoryChange = (event) => {
    const selectedCategory = event.target.value;
    if (selectedCategory === "All") {
      setFilteredItems(Menu);
    } else {
      const filteredItems = Menu.filter((item) =>
        item.category.includes(selectedCategory)
      );
      setFilteredItems(filteredItems);
    }
  };


  return (
    <>
      <nav className="navbar navbar-light bg-light shadow-sm">
        <span className="navbar-brand mb-0 m-auto h1 text-center">
          Order your favorite dish
        </span>
      </nav>
      <br />
      <div className="container">
        <ul className="nav nav-pills justify-content-center">
          <li className="nav-item">
            <a
              className={active ? "nav-link" : "nav-link active"}
              //href="javascrip:0;"
              onClick={() => filterItem("breakfast")}
            >
              Breakfast
            </a>
          </li>
          <li className="nav-item">
            <a
              className={active ? "nav-link" : "nav-link active"}
              //href="javascrip:0;"
              onClick={() => filterItem("lunch")}
            >
              Lunch
            </a>
          </li>
          <li className="nav-item">
            <a
              className={active ? "nav-link" : "nav-link active"}
              //href="javascrip:0;"
              onClick={() => filterItem("evening")}
            >
              Evening
            </a>
          </li>
          <li className="nav-item">
            <a
              className={active ? "nav-link" : "nav-link active"}
              //href="javascrip:0;"
              onClick={() => filterItem("dinner")}
            >
              Dinner
            </a>
          </li>
          <li className="nav-item">
            <a
              className={active ? "nav-link" : "nav-link active"}
              //href="javascrip:0;"
              onClick={() => setItems(Menu)}
            >
              All
            </a>
          </li>
        </ul>
      </div>

      <div className="container-fluid mt-4">
        <div className="row">
          {items.map((elem) => {
            const { id, name, image, description, price } = elem;


            return (
              <div className="col-sm-4" id={id}>
                <div class="card mb-3">
                  <div class="row no-gutters">
                    <div class="col-md-5">
                      <img class="img-fluid" src={elem.image} alt={elem.name} />
                    </div>
                    <div class="col-md-7">
                      <div class="card-body">
                        <h5 class="card-title mb-0">{elem.name}</h5>
                        <p class="card-text">{elem.description}</p>
                        <div class="d-flex justify-content-between">
                          <div class="p-1">Price: {elem.price}</div>
                          <button type="button" className="btn btn-success p-1">
                            Order Now
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </>
  );
};

export default GalleryReact;
